import { Container, Tab, Tabs } from '@material-ui/core';

class App extends React.Component {

  constructor(props){
    super(props)
    this.setState({
      value: null,
      setValue: null
    })
  }

  handleChange = (event, newValue) => {
    this.setState({ setValue: newValue});
  };

  render(){
  return (
    <Container>
    <Tabs
      value={''}
      indicatorColor="primary"
      textColor="primary"
      centered
      onChange={this.handleChange} 
      >
          <Tab label="Home">
            <HomePageComponent/>
          </Tab>
          <Tab label="SinglePage">
            <OnePost/>
          </Tab>
    </Tabs>
